import React, { useState, useEffect } from "react";
import { Link, useNavigate } from "react-router-dom";
import QuestionService from "../services/QuestionServices";

export default function Questions() {

  const [questions, setQuestions] = useState([]);
  const [dropDownValue, setDropDownValue] = useState('company');
  const [searchBarText, setSearchBarText] = useState('');
  const [filteredResults, setFilteredResults] = useState([])
  const navigate = useNavigate();

  useEffect(() => {
    retrieveQuestions();
  }, []);

  const retrieveQuestions = () => {
    QuestionService.getAll()
      .then(response => {
        setQuestions(response.data);
        setFilteredResults(response.data);
      })
      .catch(e => {
        console.log(e);
      });
  };

  const retrieveArticleHeader = (e) => {
    QuestionService.get()
      .then(response => {

      })
      .catch(e => {
        console.log(e);
      });
  };

  const handleQuestionClick = (e) =>{ 
    let path = "/questions/" + e.id; 
    navigate(path);
  }

  const handleDropdownChange = (event) => {
    setDropDownValue(event.target.value);
  };

  const onChangeSearchTitle = e => {
    const searchTitle = e.target.value;
    setSearchBarText(searchTitle);
    if (searchTitle !== '') {
      const filteredResults = questions.filter((item) => {
        return Object.values(item[dropDownValue]).join('').toLowerCase().includes(searchTitle.toLowerCase())
      })
      setFilteredResults(filteredResults)
    }
    else{
        setFilteredResults(questions)
    }
    };


  return (
    <div>
        <form className="p-10">   
            <label for="default-search" className="mb-2 text-sm font-medium text-gray-900 sr-only dark:text-gray-300">Search</label>
            <div className="relative">
                <div className="flex absolute inset-y-0 left-0 items-center pl-3 pointer-events-none">
                    <svg className="w-5 h-5 text-gray-500 dark:text-gray-400" fill="none" stroke="currentColor" viewBox="0 0 24 24" xmlns="http://www.w3.org/2000/svg"><path stroke-linecap="round" stroke-linejoin="round" stroke-width="2" d="M21 21l-6-6m2-5a7 7 0 11-14 0 7 7 0 0114 0z"></path></svg>
                </div>
                <input type="search" id="default-search" className="block p-4 pl-10 w-full text-sm text-gray-900 bg-gray-50 rounded-lg border border-gray-300 focus:ring-blue-500 focus:border-blue-500 dark:bg-gray-700 dark:border-gray-600 dark:placeholder-gray-400 dark:text-white dark:focus:ring-blue-500 dark:focus:border-blue-500" placeholder="Search companies, titles..." required/>
                {/* <button type="submit" className="text-white absolute right-2.5 bottom-2.5 bg-blue-700 hover:bg-blue-800 focus:ring-4 focus:outline-none focus:ring-blue-300 font-medium rounded-lg text-sm px-4 py-2 dark:bg-blue-600 dark:hover:bg-blue-700 dark:focus:ring-blue-800">Search</button> */}
                <div className="absolute right-2.5 bottom-2.5">
                <div>
                    <button type="button" className="inline-flex justify-center w-full rounded-md border border-gray-300 shadow-sm px-4 py-2 bg-white text-sm font-medium text-gray-700 hover:bg-gray-50 focus:outline-none focus:ring-2 focus:ring-offset-2 focus:ring-offset-gray-100 focus:ring-indigo-500" id="menu-button" aria-expanded="true" aria-haspopup="true">
                    Options

                    <svg className="-mr-1 ml-2 h-5 w-5" xmlns="http://www.w3.org/2000/svg" viewBox="0 0 20 20" fill="currentColor" aria-hidden="true">
                        <path fill-rule="evenodd" d="M5.293 7.293a1 1 0 011.414 0L10 10.586l3.293-3.293a1 1 0 111.414 1.414l-4 4a1 1 0 01-1.414 0l-4-4a1 1 0 010-1.414z" clip-rule="evenodd" />
                    </svg>
                    </button>
                </div>

                <div className="origin-top-right absolute right-0 mt-2 w-56 rounded-md shadow-lg bg-white ring-1 ring-black ring-opacity-5 divide-y divide-gray-100 focus:outline-none" role="menu" aria-orientation="vertical" aria-labelledby="menu-button" tabindex="-1">
                    <div className="py-1" role="none">
                    <a href="#" className="text-gray-700 block px-4 py-2 text-sm" role="menuitem" tabindex="-1" id="menu-item-0">Company</a>
                    </div>
                    <div className="py-1" role="none">
                    <a href="#" className="text-gray-700 block px-4 py-2 text-sm" role="menuitem" tabindex="-1" id="menu-item-2">Position</a>
                    </div>
                    <div className="py-1" role="none">
                    <a href="#" className="text-gray-700 block px-4 py-2 text-sm" role="menuitem" tabindex="-1" id="menu-item-4">Question title</a>
                    </div>
                </div>
                </div>
            </div>
        </form>
        <ul className="grid grid-rows-3 grid-flow-col gap-4 mt-4 px-10">
            {filteredResults.map((question, index) => (
                <li
                key={question.id}
                className="shadow-lg bg-blue-100 text-blue-500 text-lg font-bold text-center p-10 rounded-lg row-span-3 col-span-1"                
                >

                <Link
                    className={`todo-title mr-2`}
                    title={question.question}
                    to = {`/questions/${question.id}`}
                    style={{ textDecoration: 'none' }}
                >
                    <h2 className="break-after-column text-blue-900">{question.company + " | " + question.question}<br /><br /></h2>
                    <p className="question-answer line-clamp-5">{question.answer}</p>
                </Link>

                {question.articles.map((article, question_index) => (
                <li key = {article.id}
                className="list"      >
                    <Link
                    to={"/articles/" + article.id}
                    className="badge text-blue-700"
                    key={question_index}
                    style={{ textDecoration: 'none' }}
                    >
                    {article.headline}
                    </Link>

                </li>
                ))}

                </li>
            ))}
        </ul>

      </div>



  );
}
